import React from 'react';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
} from '@mui/material';
import {
  CloudSync,
  Storage,
  Security,
  Speed,
} from '@mui/icons-material';
import { getCurrentClientConfig } from '../../config/clientConfig';

const IntegrationGrid: React.FC = () => {
  const clientConfig = getCurrentClientConfig();

  const integrations = [
    {
      icon: <Security />,
      title: 'Veeva Vault',
      description: 'Direct integration with Veeva Vault for seamless document management and regulatory submissions',
      category: 'Document Management',
      features: ['Real-time sync', 'Automated workflows', 'Compliance tracking']
    },
    {
      icon: <CloudSync />,
      title: 'AWS Data Lake',
      description: 'Connect to AWS S3, Redshift, and other AWS services for comprehensive data integration',
      category: 'Cloud Data Platform',
      features: ['S3 integration', 'Redshift analytics', 'Lambda processing']
    },
    {
      icon: <Storage />,
      title: 'Azure Data Platform',
      description: 'Native integration with Azure Data Lake, Synapse Analytics, and Azure SQL databases',
      category: 'Microsoft Cloud',
      features: ['Data Lake Gen2', 'Synapse pipelines', 'Power BI dashboards']
    },
    {
      icon: <Speed />,
      title: 'Databricks Platform',
      description: 'Advanced analytics and ML capabilities through Databricks unified data platform',
      category: 'Analytics & ML',
      features: ['Delta Lake', 'MLflow integration', 'Spark processing']
    }
  ];

  const additionalConnectors = [
    {
      title: 'Audit Logs & Compliance',
      description: 'Comprehensive audit logging with 21 CFR Part 11 compliance and real-time monitoring',
      category: 'Regulatory Compliance'
    },
    {
      title: 'Workflow Automations',
      description: 'Automated document routing, approval workflows, and submission processes',
      category: 'Process Automation'
    }
  ];

  return (
    <Box sx={{ bgcolor: '#ffffff', py: 8 }}>
      <Container maxWidth="xl">
        <Box sx={{ textAlign: 'center', mb: 6 }}>
          <Typography 
            variant="overline" 
            sx={{ 
              color: clientConfig.primaryColor,
              fontWeight: 600,
              letterSpacing: 1,
              fontFamily: 'SF Pro Display, -apple-system, BlinkMacSystemFont, sans-serif'
            }}
          >
            INTEGRATIONS & CONNECTORS
          </Typography>
          <Typography 
            variant="h3" 
            sx={{ 
              fontWeight: 600,
              color: 'white',
              mt: 2,
              mb: 3,
              fontFamily: 'SF Pro Display, -apple-system, BlinkMacSystemFont, sans-serif'
            }}
          >
            Connect Your Data Ecosystem
          </Typography>
          <Typography 
            variant="h6" 
            sx={{ 
              color: 'rgba(255, 255, 255, 0.7)',
              fontWeight: 400,
              maxWidth: 700,
              mx: 'auto',
              fontSize: '21px',
              fontFamily: 'SF Pro Display, -apple-system, BlinkMacSystemFont, sans-serif'
            }}
          >
            Seamlessly integrate with leading pharmaceutical data platforms 
            and document management systems
          </Typography>
        </Box>

        {/* Main Integration Cards */}
        <Grid container spacing={4} sx={{ mb: 6 }}>
          {integrations.map((integration, index) => (
            <Grid item xs={12} sm={6} md={3} key={index}>
              <Card
                sx={{
                  height: '100%',
                  bgcolor: 'rgba(255, 255, 255, 0.05)',
                  border: '1px solid rgba(255, 255, 255, 0.1)',
                  backdropFilter: 'blur(20px)',
                  color: 'white',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                    bgcolor: 'rgba(255, 255, 255, 0.08)',
                    border: `1px solid ${clientConfig.primaryColor}40`,
                    transition: 'all 0.3s ease'
                  }
                }}
              >
                <CardContent sx={{ p: 4 }}>
                  <Box
                    sx={{
                      width: 56,
                      height: 56,
                      borderRadius: 2,
                      bgcolor: `${clientConfig.primaryColor}20`,
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'center',
                      mb: 3,
                      color: clientConfig.primaryColor
                    }}
                  >
                    {integration.icon}
                  </Box>
                  <Typography 
                    variant="h6" 
                    sx={{ 
                      fontWeight: 600,
                      mb: 2,
                      fontFamily: 'SF Pro Display, -apple-system, BlinkMacSystemFont, sans-serif'
                    }}
                  >
                    {integration.title}
                  </Typography>
                  <Typography 
                    variant="body2" 
                    sx={{ 
                      color: 'rgba(255, 255, 255, 0.7)',
                      lineHeight: 1.6,
                      mb: 3,
                      fontSize: '15px'
                    }}
                  >
                    {integration.description}
                  </Typography>
                  <Box sx={{ mb: 2 }}>
                    {integration.features.map((feature, idx) => (
                      <Typography 
                        key={idx}
                        variant="caption" 
                        sx={{ 
                          display: 'block',
                          color: clientConfig.primaryColor,
                          fontWeight: 500,
                          mb: 0.5,
                          fontSize: '13px'
                        }}
                      >
                        • {feature}
                      </Typography>
                    ))}
                  </Box>
                  <Typography 
                    variant="caption" 
                    sx={{ 
                      color: 'rgba(255, 255, 255, 0.5)',
                      fontWeight: 600,
                      textTransform: 'uppercase',
                      letterSpacing: 0.5,
                      fontSize: '11px'
                    }}
                  >
                    {integration.category}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>

        {/* Additional Features */}
        <Grid container spacing={4}>
          {additionalConnectors.map((connector, index) => (
            <Grid item xs={12} md={6} key={index}>
              <Card
                sx={{
                  bgcolor: 'rgba(255, 255, 255, 0.03)',
                  border: '1px solid rgba(255, 255, 255, 0.08)',
                  color: 'white',
                  '&:hover': {
                    bgcolor: 'rgba(255, 255, 255, 0.06)',
                    transition: 'all 0.3s ease'
                  }
                }}
              >
                <CardContent sx={{ p: 4 }}>
                  <Typography 
                    variant="h6" 
                    sx={{ 
                      fontWeight: 600,
                      mb: 2,
                      fontFamily: 'SF Pro Display, -apple-system, BlinkMacSystemFont, sans-serif'
                    }}
                  >
                    {connector.title}
                  </Typography>
                  <Typography 
                    variant="body2" 
                    sx={{ 
                      color: 'rgba(255, 255, 255, 0.7)',
                      lineHeight: 1.6,
                      mb: 2,
                      fontSize: '15px'
                    }}
                  >
                    {connector.description}
                  </Typography>
                  <Typography 
                    variant="caption" 
                    sx={{ 
                      color: clientConfig.primaryColor,
                      fontWeight: 600,
                      textTransform: 'uppercase',
                      letterSpacing: 0.5,
                      fontSize: '11px'
                    }}
                  >
                    {connector.category}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default IntegrationGrid;
